//----------------------- NOISEBURST ------------------------- 

noiseburst(gate,P) = noise : *(gate : trigger(P))
	with { 
	upfront(x) = (x-x') > 0; 
	decay(n,x) = x - (x>0)/n; 
	release(n) = + ~ decay(n); 
	trigger(n) = upfront : release(n) : > (0.0);
	};
	
